import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Authentication from "./components/Authentication";
import NotFound from "./components/NotFound";

// HR Pages
import AdminDashboard from "./hr/AdminDashboard";
import EmployeeList from "./hr/EmployeeList";
import HrTraining from "./hr/HRTraining";
import HrReporting from "./hr/Reports";
import AssignTraining from "./hr/AssignTraining";
import HrProfile from "./hr/Profile";
import HrCareer from "./hr/HRCareer";

// Manager Pages
import ManagerDashboard from "./manager/ManagerDashboard"; // Assume Manager Dashboard
import LeaveRequests from "./manager/LeaveRequests";
import ShiftSchedule from "./manager/ShiftSchedule";
import TeamReports from "./manager/TeamReports";
import TaskManagement from "./manager/TaskManagement";
import ManagerProfile from "./manager/ManagerProfile";

// Employee Pages
import EmployeeDashboard from "./employee/EmployeeDashboard";
import LeaveManagement from "./employee/LeaveManagement";
import EmployeeProfile from "./employee/Profile";
import Schedule from "./employee/Schedule";
import Tasks from "./employee/Tasks";
import EmployeeTraining from "./employee/Training";
import Career from "./employee/Career";

// Shared Pages
import Announcements from "./components/Announcements"; // Shared announcements page

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Authentication />} />

        {/* HR Routes */}
        <Route path="/hr">
          <Route path="AdminDashboard" element={<AdminDashboard />} />
          <Route path="employeelist" element={<EmployeeList />} />
          <Route path="training" element={<HrTraining />} />
          <Route path="reports" element={<HrReporting />} />
          <Route path="assigntraining" element={<AssignTraining />} />
          <Route path="profile" element={<HrProfile />} />
          <Route path="career-management" element={<HrCareer />} />
          <Route path="announcements" element={<Announcements />} />
          <Route path="/hr/leave-applications" element={<HRLeave />} />
        </Route>

        {/* Manager Routes */}
        <Route path="/manager">
          <Route path="dashboard" element={<ManagerDashboard />} />
          <Route path="leave-requests" element={<LeaveRequests />} />
          <Route path="shift-schedule" element={<ShiftSchedule />} />
          <Route path="team-reports" element={<TeamReports />} />
          <Route path="taskmanagement" element={<TaskManagement />} />
          <Route path="profile" element={<ManagerProfile />} />
          <Route path="announcements" element={<Announcements />} />
          <Route path="/manager/leave-requests" element={<ManagerLeave />} />
        </Route>

        {/* Employee Routes */}
        <Route path="/employees/dashboard" element={<EmployeeDashboard />}>
          <Route path="leave-management" element={<LeaveManagement />} />
          <Route path="profile" element={<EmployeeProfile />} />
          <Route path="schedule" element={<Schedule />} />
          <Route path="tasks" element={<Tasks />} />
          <Route path="training" element={<EmployeeTraining />} />
          <Route path="career" element={<Career />} />
          <Route path="announcements" element={<Announcements />} />
        </Route>

        {/* Catch-All Route */}
        <Route path="*" element={<NotFound />} />
      </Routes>
    </Router>
  );
}

export default App;
